const Categories = () => {
    return (
        <div>
            <p>
                <u>All Categories</u></p>
            <navigation>
                <ul>
                    <li>Mobiles</li>
                    <li>Laptop</li>
                </ul>
            </navigation>
        </div>
    );
}
 
export default Categories;
